import React from 'react';
import {
  List,
  Edit,
  BooleanField,
  Datagrid,
  TextField,
  ReferenceField,
  EditButton,
  SimpleForm,
  TextInput
} from 'react-admin';

const ConditionBooleanField = ({ record, ...rest }) => {
  // console.log(record.report_users);
    return record.report_users
        ? <BooleanField initialValue="true" {...rest} />
        : <BooleanField initialValue="false" {...rest} />;
}

export const VoiceList = props => (
  <List {...props}>
    <Datagrid>
      <TextField label="Location" source="address" />
      <ConditionBooleanField source="report_users" />
      <TextField source="comments" />
      <EditButton />
    </Datagrid>
  </List>
);
